  ('4',NULL,'Godoy Cruz');

CREATE TABLE usuario (
  id varchar(255),
  alta datetime,
  apellido varchar(255),
  baja datetime,
  clave varchar(255),
  mail varchar(255),
  nombre varchar(255),
  foto_id varchar(255),
  zona_id varchar(255),
  PRIMARY KEY (id),
  FOREIGN KEY (zona_id) REFERENCES zona (id),
  FOREIGN KEY (foto_id) REFERENCES foto (id)
);

