CREATE TABLE mascota (
  id varchar(255),
  alta datetime,
  baja datetime,
  nombre varchar(255),
  sexo character,
  foto_id varchar(255),
  usuario_id varchar(255),
  PRIMARY KEY (id),
  FOREIGN KEY (foto_id) REFERENCES foto (id),
  FOREIGN KEY (usuario_id) REFERENCES usuario (id)
);

CREATE TABLE voto (
  id varchar(255),
  fecha datetime,
  respuesta datetime,
  mascota1_id varchar(255),
  mascota2_id varchar(255),
  PRIMARY KEY (id),
  FOREIGN KEY (mascota1_id) REFERENCES mascota (id),
  FOREIGN KEY (mascota2_id) REFERENCES mascota (id)
);

